import React from "react";
import { BrowserRouter as Router, Route, Switch, Link } from "react-router-dom";
import BodegasPage from "/pages/BodegasPage";
import VinosPage from "/pages/VinosPage";

const App = () => {
  return (
    <Router>
      <div className="p-grid p-justify-center p-m-5">
        <nav className="p-col-12 p-md-8">
          <ul className="p-menu">
            <li className="p-menuitem">
              <Link to="/bodegas">Bodegas</Link>
            </li>
            <li className="p-menuitem">
              <Link to="/vinos">Vinos</Link>
            </li>
          </ul>
        </nav>

        {/* Rutas para navegar entre páginas */}
        <Switch>
          <Route path="/bodegas">
            <BodegasPage />
          </Route>
          <Route path="/vinos">
            <VinosPage />
          </Route>
          <Route path="/" exact>
            <h1>Bienvenido a la aplicación de Bodegas y Vinos</h1>
          </Route>
        </Switch>
      </div>
    </Router>
  );
};

export default App;
